// al inicio del componente
import React, { useEffect, useMemo, useState } from 'react';
import { useNavigate } from 'react-router-dom';

const currentYear = new Date().getFullYear();

const Vehiculos = () => {
  const [vehicles, setVehicles] = useState([]);
  const [search, setSearch] = useState('');
  const [form, setForm] = useState({ patente: '', marca: '', modelo: '', anio: '', kilometraje: '' });
  const [editingId, setEditingId] = useState(null);
  const [originalKilometraje, setOriginalKilometraje] = useState(null);
  const [successMessage, setSuccessMessage] = useState('');

  const navigate = useNavigate();

  const fetchVehicles = () => {
    fetch('http://localhost:8000/vehiculos/')
      .then(res => res.json())
      .then(data => {
        const sorted = data.sort((a, b) => a.patente.localeCompare(b.patente));
        setVehicles(sorted);
      })
      .catch(err => console.error('Error cargando vehículos:', err));
  };

  useEffect(() => {
    fetchVehicles();
  }, []);

  const filteredVehicles = useMemo(() => {
    return vehicles
      .filter(vehicle => vehicle.patente.toLowerCase().includes(search.toLowerCase()));
  }, [vehicles, search]);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const { patente, marca, modelo, anio, kilometraje } = form;

    if (!patente || !marca || !modelo || !anio || !kilometraje) {
      alert('Todos los campos son obligatorios.');
      return;
    }

    const parsedAnio = parseInt(anio);
    const parsedKm = parseFloat(kilometraje);

    if (isNaN(parsedAnio) || parsedAnio < 1950 || parsedAnio > currentYear) {
      alert(`El año debe estar entre 1950 y ${currentYear}`);
      return;
    }

    if (isNaN(parsedKm) || parsedKm < 0) {
      alert('El kilometraje debe ser un número positivo.');
      return;
    }

    if (editingId !== null) {
      if (parsedKm < originalKilometraje) {
        alert('No se puede ingresar un kilometraje menor al actual.');
        return;
      }

      const confirmEdit = window.confirm('¿Deseas guardar los cambios en el kilometraje?');
      if (!confirmEdit) return;
    }

    const method = editingId ? 'PUT' : 'POST';
    const url = editingId
      ? `http://localhost:8000/vehiculos/${editingId}`
      : 'http://localhost:8000/vehiculos/';

    const res = await fetch(url, {
      method,
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ patente, marca, modelo, anio, kilometraje }),
    });

    if (res.ok) {
      fetchVehicles();
      setForm({ patente: '', marca: '', modelo: '', anio: '', kilometraje: '' });
      setEditingId(null);
      setOriginalKilometraje(null);

      setSuccessMessage(editingId ? '✅ Datos actualizados correctamente.' : '✅ Vehículo agregado exitosamente.');
      setTimeout(() => setSuccessMessage(''), 3000);
    } else if (res.status === 409) {
      alert('Ya existe un vehículo con esa patente.');
    } else {
      alert('Error al guardar el vehículo.');
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('¿Estás seguro de eliminar este vehículo?')) return;

    const res = await fetch(`http://localhost:8000/vehiculos/${id}`, {
      method: 'DELETE',
    });

    if (res.ok) {
      fetchVehicles();
    } else if (res.status === 400 || res.status === 403) {
      alert('No se puede eliminar el vehículo porque tiene mantenciones asociadas.');
    } else {
      alert('Error al eliminar vehículo.');
    }
  };

  const handleEdit = (vehiculo) => {
    setForm({
      patente: vehiculo.patente,
      marca: vehiculo.marca,
      modelo: vehiculo.modelo,
      anio: vehiculo.anio,
      kilometraje: vehiculo.kilometraje,
    });
    setEditingId(vehiculo.id);
    setOriginalKilometraje(parseFloat(vehiculo.kilometraje));
  };

  return (
    <div className="p-6 w-full max-w-6xl mx-auto relative">
      <button
        onClick={() => navigate(-1)}
        className="absolute top-4 left-2 bg-gray-400 hover:bg-gray-500 text-white px-3 py-2 rounded"
      >
        ← Volver al inicio
      </button>

      <h2 className="text-3xl font-bold mb-6 text-center">🚗 Gestión de Vehículos</h2>

      {successMessage && (
        <div className="mb-4 p-3 bg-green-100 text-green-700 rounded text-center font-medium">
          {successMessage}
        </div>
      )}

      {/* Buscar */}
      <div className="relative mb-4">
        <input
          type="text"
          placeholder="Buscar por patente..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          className="p-2 pl-10 border rounded w-full"
        />
        <span className="absolute left-3 top-2.5 text-gray-500">🔍</span>
      </div>

      {/* Formulario */}
      <form onSubmit={handleSubmit} className="mb-6 bg-white p-4 rounded shadow">
        <h3 className="text-lg font-semibold mb-2">{editingId ? '✏️ Editar vehículo' : '➕ Agregar nuevo vehículo'}</h3>
        <div className="grid grid-cols-1 sm:grid-cols-5 gap-4">
          <input type="text" name="patente" placeholder="Patente" value={form.patente} onChange={handleChange} className="border p-2 rounded" disabled={editingId !== null} />
          <input type="text" name="marca" placeholder="Marca" value={form.marca} onChange={handleChange} className="border p-2 rounded" disabled={editingId !== null} />
          <input type="text" name="modelo" placeholder="Modelo" value={form.modelo} onChange={handleChange} className="border p-2 rounded" disabled={editingId !== null} />
          <input type="number" name="anio" placeholder="Año" min="1950" max={currentYear} value={form.anio} onChange={handleChange} className="border p-2 rounded" disabled={editingId !== null} />
          <input type="number" name="kilometraje" placeholder="Kilometraje" value={form.kilometraje} onChange={handleChange} className="border p-2 rounded" />
        </div>
        <button type="submit" className="mt-4 bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700">
          {editingId ? 'Guardar cambios' : 'Agregar vehículo'}
        </button>
      </form>

      {/* Tabla */}
      {filteredVehicles.length === 0 ? (
        <p className="text-center text-gray-500">No hay vehículos registrados.</p>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full bg-white border border-gray-300 rounded shadow">
            <thead className="bg-gray-100 text-left">
              <tr>
                <th className="p-3 border-b">Patente</th>
                <th className="p-3 border-b">Marca</th>
                <th className="p-3 border-b">Modelo</th>
                <th className="p-3 border-b">Año</th>
                <th className="p-3 border-b">Kilometraje (km)</th>
                <th className="p-3 border-b text-center">Acciones</th>
              </tr>
            </thead>
            <tbody>
              {filteredVehicles.map(vehicle => (
                <tr key={vehicle.id} className="hover:bg-gray-50">
                  <td className="p-3 border-b">{vehicle.patente}</td>
                  <td className="p-3 border-b">{vehicle.marca}</td>
                  <td className="p-3 border-b">{vehicle.modelo}</td>
                  <td className="p-3 border-b">{vehicle.anio}</td>
                  <td className="p-3 border-b">{vehicle.kilometraje}</td>
                  <td className="p-3 border-b text-center space-x-2">
                    <button onClick={() => handleEdit(vehicle)} className="bg-yellow-400 text-white px-3 py-1 rounded hover:bg-yellow-500">
                      Editar
                    </button>
                    <button onClick={() => handleDelete(vehicle.id)} className="bg-red-500 text-white px-3 py-1 rounded hover:bg-red-600">
                      Eliminar
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default Vehiculos;
